class Foo {
    private _privateProperty: string;

    constructor(
        privateProperty: string,
        private readonly anotherProperty?: string,
    ) {
        this._privateProperty = privateProperty;
    }

    foo() {
        console.log('Hello, world!');
    }

    baz() {
        console.log('baz called');
    }

    bar() {
        this.foo();
        console.log('Goodbye, world!');
    }
}

